import './Navbar.css';
import React, { useState, useEffect } from 'react';
import Logo from '../../images/logo.png';
import { Link } from "react-router-dom";
import {FaHome, FaListUl, FaListOl, FaTable, FaComment, FaUser} from 'react-icons/fa'

export const Navbar = () => {
  const [showNavbar, setShowNavbar] = useState(false);

  const handleScroll = () => {
    if (window.scrollY > 100) {
      setShowNavbar(true);
    } else {
      setShowNavbar(false);
    }
  };

  useEffect(() => {
    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  const navbarClass = showNavbar ? "navbar navbar-expand-lg bg-body-tertiary navbar-style navbar-fixed" : "navbar navbar-expand-lg bg-body-tertiary navbar-style";

  return (
    <nav className={navbarClass}>
      <div className="container-fluid">
        <a className="navbar-brand" href="#">
          <Link to="/"><img className='logo' src={Logo} /></Link>
        </a>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse nav-items-container" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <a className="nav-link active" aria-current="page">
                <Link to="/"><FaHome className='icons' />Home</Link>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link">
                <Link to="/formations"><FaListUl className='icons' />Formations</Link>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" aria-current="page">
                <Link to="/workshops"><FaListOl className='icons' />Workshops</Link>
              </a>
            </li> 
            <li className="nav-item">
              <a className="nav-link" aria-current="page">
                <Link to="/organisation"><FaTable className='icons' />Organisation</Link>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" aria-current="page">
                <Link to="/feedback"><FaComment className='icons' />Formations Feedback</Link>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" aria-current="page">
                <Link to="/feedbackWorkshops"><FaComment className='icons' />Workshops Feedback</Link>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" aria-current="page">
                <Link to="/users"><FaUser className='icons' />Users</Link>
              </a>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  )
}
